  // State for all transactions
  const [transactions, setTransactions] = useState(allTransactions)
  // console.log(allTransactions)

  return (
    <div>
      <Search />
      <AddTransactionForm />
      <TransactionsList transactionsData={transactions} />
    </div>
  );
}

export default AccountContainer;
